import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faChalkboard, faChalkboardTeacher, faFileArrowDown, faPerson, faRightFromBracket, faUser, faUserGroup, faUsers } from "@fortawesome/free-solid-svg-icons";
import {useNavigate} from 'react-router-dom'


const NavBar = (props) => {

    const navigate= useNavigate()

    const CustomLink=(props)=> {
        const path = window.location.pathname;
        return (
            <li className={props.visibility==='visible' ? 'visible' : 'hide'}>
                <button draggable='false' className={path===props.href ? `text-decoration-none fs-5 usButton` : "text-decoration-none fs-5 usButton"} onClick={()=>navigate(props.href)}>
                    <FontAwesomeIcon icon={props.icon} className="i"/>
                    <span>{props.span}</span>
                </button>
            </li>
        )
    }

    return (
        <button style={width='100%'}>


        <div id="sideBar" className={`sideBar user-select-none no-drag ${props.className}`}>
            <div className="wrapper d-flex">
                <ul className="list-unstyled">

                    <CustomLink visibility='visible' href='/' icon={faChalkboard} name='home' span='Clasrooms'></CustomLink>
                    <CustomLink visibility='visible'  href='/' icon={faChalkboardTeacher} name='home' span='Teachers'></CustomLink>
                    <CustomLink visibility='visible'  href='/' icon={faUserGroup} name='home' span='Students'></CustomLink>
                    <CustomLink visibility='visible'  href='/' icon={faPerson} name='home' span='Parents'></CustomLink>
                    <CustomLink visibility='visible'  href='/' icon={faFileArrowDown} name='home' span='Files'></CustomLink>

                    <div className="d-flex flex-column-reverse">
                        <CustomLink visibility='not visible'  href='/' icon={faUser} name='home' span='Administrators'></CustomLink>
                        <CustomLink visibility='not visible'  href='/' icon={faUser} name='home' span='Educational Center'></CustomLink>
                        <CustomLink visibility='visible'  href='/' icon={faUser} name='home' span='Management'></CustomLink>
                    </div>

                    <CustomLink visibility='visible' href='' icon={faRightFromBracket} name='home' span='Log out'></CustomLink>
                </ul>
            </div> 
        </div>
        </button>
    )
}

export default NavBar
